import React, {Component} from 'react'
import {FaToggleOff, FaToggleOn} from "react-icons/fa"

let endpoint = "http://localhost:9000"

const Task = ({id, task, task_status, date, priority, update}: {id: string, task: string, task_status: boolean, date: Date, priority: number, update: {}}) => {    
    return (
        <div>
            <button>
                {task_status ? <FaToggleOn/> : <FaToggleOff/>}
            </button>
            <h2>{task}</h2>
        </div>
    )

}

export default Task
